import React from 'react';
import BannerImage from '../Banner-Image /image-banner';

const App = () => {
  return (
    <div>
      <h1>Welcome to my website</h1>
      <BannerImage src="https://cdn.pixabay.com/photo/2023/02/06/10/02/man-7771583_640.jpg" alt="Banner Image" style={{ maxHeight: '300px' }} />
      <p>Some content below the banner image</p>
    </div>
  );
};

export default App;
